from typing import List


def all_prefixes(string: str) -> List[str]:
    """ Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes('abc')
    ['a', 'ab', 'abc']
    """
    prefixes = []
    for char in string:
        if char in 'a':
            prefixes.append('a')
        elif char in 'ab':
            prefixes.append('ab')
        elif char in 'abc':
            prefixes.append('abc')
        else:
            prefixes.append(char)
    return prefixes

